import Ajv from "ajv"
import { FETCH_DATA } from '../constants';

const _fetchData = data => ({
  type: FETCH_DATA,
  data,
});

export const fetchData = (data) => dispatch => {

  const schema = {
    type: "object",
    properties: {
      _id: {type: "string"},
      uid: {type: "number"},
      name: {type: "string"},
      pass: {type: "string"},
      email: {type: "string"},
      gender: {type: "string"},
      type_login: {type: "string"},
      image_url: {type: "string"},
    },
    required: ["uid", "name", "email" ],
    additionalProperties: false,
  }
  const ajv = new Ajv() 
  const validate = ajv.compile(schema)

  console.log("fetchData : >> ", data )

  dispatch(_fetchData(data));
}
